import useConsoleLog from './ConsoleLog'

const logLevel = {
    error: 'error',
    warning: 'warning',
    info: 'info',
    debug: 'debug'
}

class Log{
    constructor(userId, timestamp, level, message, data = null){
        this.userId = userId;
        this.timestamp = timestamp;
        this.message = message;
        this.data = data ? JSON.stringify(data) : null
    }

    userId;
    timestamp;
    level;
    message;
    data;
}

const useLoggerService = () => {
    const loggers = [useConsoleLog()]
    const userID = 0;

    var _generateLogEntry = (level, message, data = null) => {
        return new Log(userID, new Date().toISOString(), level, message, data)
    }

    var _log = (logEntry) => {
        loggers.forEach((logger)=>{
            logger.log(logEntry);
        })
    }

    var error = (message, exception) => {
        var logEntry = _generateLogEntry(logLevel.error, message, exception);
        _log(logEntry);
    }

    var warning = (message) => {
        var logEntry = _generateLogEntry(logLevel.warning, message);
        _log(logEntry);
    }

    var info = (message) => {
        var logEntry = _generateLogEntry(logLevel.info, message);
        _log(logEntry);
    }

    var debug = (message, data) => {  
        var logEntry = _generateLogEntry(logLevel.debug, message, data);
        _log(logEntry);
    }

    return {
        error: error,
        warning: warning,
        info: info,
        debug: debug
    }
}

export default useLoggerService;
